Join us at 
‘Table Design Exhibition - Celebrate Art and Creativity ‘, between 31st of October -2nd of November at @hiltonistanbulbosphorus in İstanbul ! 

Let’s celebrate art and creativity of luxury wedding and event industry at 100th Anniversary of Turkey,experiencing the magnificent designs of world celebrity designers, meeting wedding industry friends at networking sessions, learning from the experts at pannel discussions, discovering the hidden beauties of İstanbul at city excursions and dancing together at themed parties!

Tickets are on sale at www.tabledesignexhibition.com 🇹🇷🎉🎉
This project is powered by @kmeventsturkeydubai and @bluechipevent ! 

